import scrapy

from rent_scraper.item_loaders.abode_loader import AbodePropertyLoader
from rent_scraper.item_loaders.cliftons_loader import CliftonsPropertyLoader
from rent_scraper.item_loaders.ocean_loader import OceanPropertyLoader
from rent_scraper.items import PropertyItem


class CliftonsSpider(scrapy.Spider):
    name = "cliftons"
    allowed_domains = ["cliftonsestateagents.co.uk"]
    custom_settings = {'FEED_URI': 'properties_cliftons.json'}

    def start_requests(self):
        return [scrapy.FormRequest("http://www.cliftonsestateagents.co.uk/search.aspx?ListingType=6&areainformation=&areainformationname=&radius=0&igid=&imgid=9&egid=&emgid=&category=1&defaultlistingtype=5&markettype=0&cur=GBP&umcids=0",
                                   formdata={'__EVENTARGUMENT': 'OrderByColumnIndex=0&Page=1&OrderByDirection=0&ItemsPerPage=9999&Currency=GBP',
                                             '__ASYNCPOST': 'true',
                                             '__EVENTTARGET': 'ctl00$ctl09',
                                             '__EVENTVALIDATION': '',
                                             '__LASTFOCUS': '',
                                             '__VIEWSTATE': '',
                                             'ctl00$cntrlCenterRegion$ctl01$cntrlFilterBar$cntrlItemsPerPage': '10',
                                             'ctl00$cntrlCenterRegion$ctl01$cntrlFilterBar$priceordering': 'cntrlPriceAscending',
                                             'ctl00$cntrlCenterRegion$ctl01$cntrlMappingAjaxHelper$txtAllowSavingControls': '1',
                                             'ctl00$cntrlCenterRegion$ctl01$cntrlMappingAjaxHelper$txtPage': '1',
                                             'ctl00$cntrlCenterRegion$ctl01$cntrlMappingAjaxHelper$txtRecordsPerPage': '10',
                                             'ctl00$ctl09': 'ctl00$ctl09|ctl00$ctl09',
                                             'ctl00_cntrlCenterRegion_ctl01_cntrlFilterBar_cntrlItemsPerPage_ClientState': '{"logEntries":[],"value":"10","text":"10","enabled":true}',
                                             'ctl00_cntrlLeftRegionBottom_cntrlSavedPropertiesInline_cntrlSavedProperties_cntrlSavedPropertiesTabStrip_ClientState': '{"selectedIndexes":[],"logEntries":[],"scrollState":{}}',
                                             },
                                   headers={'Origin': 'http://www.cliftonsestateagents.co.uk',
                                            'Cache-Control': 'no-cache',
                                            'Accept-Encoding': 'gzip, deflate',
                                            'X-MicrosoftAjax': 'Delta=true',
                                            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/47.0.2526.106 Safari/537.36',
                                            'Accept': '*/*',
                                            'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8'
                                            },
                                   method='POST',
                                   callback=self.parse)]

    def parse(self, response):
        for href in response.xpath("//a[contains(text(), 'Full Details')]/@href"):
            url = response.urljoin(href.extract())
            yield scrapy.Request(url, callback=self.parse_property_page)

    def parse_property_page(self, response):
        number_bedrooms = int(response.xpath("//span[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblBedrooms']/text()").extract()[0])
        l = CliftonsPropertyLoader(item=PropertyItem(), response=response, number_bedrooms=number_bedrooms)
        l.add_xpath('area',
                    "//span[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblFormattedAddress']/text()")
        l.add_xpath('street_name',
                    "//span[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblFormattedAddress']/text()")
        # l.add_css('postcode', '.detailHeader > h2::text')
        l.add_xpath('price_per_month',
                    "//span[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblFormattedPrice']/text()")
        l.add_value('agent', 'Cliftons')
        l.add_xpath('number_bedrooms',
                    "//span[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblBedrooms']/text()")
        l.add_xpath('number_bedrooms',
                    "//span[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblBathrooms']/text()")
        # TODO: bathrooms
        l.add_xpath('description',
                    "//table[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_cntrlBulletedList']//li//text()")
        l.add_xpath('description',
                    "//div[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblBriefDescription']//text()")
        l.add_xpath('description',
                    "//div[@id='ctl00_cntrlCenterRegion_cntrlProperties_ctl00_ctl00_cntrlFullDescription']//text()")
        l.add_xpath('amenities',
                    "//table[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_cntrlBulletedList']//li//text()")
        l.add_xpath('amenities',
                    "//div[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblBriefDescription']//text()")
        l.add_xpath('amenities',
                    "//div[@id='ctl00_cntrlCenterRegion_cntrlProperties_ctl00_ctl00_cntrlFullDescription']//text()")
        l.add_xpath('heating_type',
                    "//table[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_cntrlBulletedList']//li//text()")
        l.add_xpath('heating_type',
                    "//div[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_lblBriefDescription']//text()")
        l.add_xpath('heating_type',
                    "//div[@id='ctl00_cntrlCenterRegion_cntrlProperties_ctl00_ctl00_cntrlFullDescription']//text()")

        l.add_xpath('epc_rating',
                    "//table[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_cntrlBulletedList']//li//text()")
        l.add_xpath('let_agreed',
                    "//span[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_cntrlStatus_lblStatus']/text()")

        l.add_value('url', response.url)
        l.add_value('image_url', response.urljoin(response.xpath(
                "//img[@id='ctl00_cntrlCenterRegion_cntrlProperties_item_0_ctl00_cntrlGallery_cntrlMainPhoto_ctl00_cntrlAsset']/@src")
                                                  .extract()[0]))

        return l.load_item()
